import React, { Component } from 'react';

const ImageView  = ({src,offShow}) =>{
    const styleDiv = {
        width:'700px',
        height:'500px',
        zIndex:'100',
        backgroundColor:'white'
    }
    return (
        <div style={styleDiv}>
            <button onClick={()=>offShow(false)}>X</button>
            <img src={src} />
        </div>
    )
}

export default ImageView;
